import { data } from '../../mocks/dummyData';


function Projects() {
  const[projects,setProjects] = useState([]);

  useEffect(() => {
    setProjects(data)
  },[projects]);
  return (
    <div>
       <ul>
        {projects.map(project => (
          <p>{project.name}</p>
        ))}
       </ul>
    </div>
  )
}

export default Projects
